import React, { useState } from 'react';
import './HomePage.css';
import { Link } from 'react-router-dom';
import HeroSection from '../components/HeroSection';
import RegionsSection from '../components/RegionsSection';
import FeaturedPropertiesSection from '../components/FeaturedPropertiesSection';
import InquiryFormSection from '../components/InquiryFormSection';
import FeaturedAgenciesSection from '../components/FeaturedAgenciesSection';
import ExploreDestinationsSection from '../components/ExploreDestinationsSection';
import LatestNewsSection from '../components/LatestNewsSection';
import ClientSuccessStoriesSection from '../components/ClientSuccessStoriesSection';
import Footer from '../components/Footer';

const HomePage = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const [regionsOpen, setRegionsOpen] = useState(false);
  const [propertiesOpen, setPropertiesOpen] = useState(false);

  const toggleMenu = () => setMenuOpen(!menuOpen);
  const toggleRegions = () => setRegionsOpen(!regionsOpen);
  const toggleProperties = () => setPropertiesOpen(!propertiesOpen);

  return (
    <div className="homepage">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="navbar-logo">
          <span className="logo-blue">Spain</span><span className="logo-red">Undiscovered</span>
        </div>
        <button className="hamburger" onClick={toggleMenu} aria-label="Toggle menu">
          <span className={`bar ${menuOpen ? 'open' : ''}`}></span>
          <span className={`bar ${menuOpen ? 'open' : ''}`}></span>
          <span className={`bar ${menuOpen ? 'open' : ''}`}></span>
        </button>
        <ul className={`navbar-menu ${menuOpen ? 'open' : ''}`}>
          <li><Link to="/" onClick={() => setMenuOpen(false)}>Home</Link></li>
          <li className="dropdown" onMouseEnter={() => setRegionsOpen(true)} onMouseLeave={() => setRegionsOpen(false)}>
            <button className="dropdown-toggle" onClick={toggleRegions} aria-expanded={regionsOpen}>
              Regions
            </button>
            <ul className={`dropdown-menu ${regionsOpen ? 'open' : ''}`}>
              <li><Link to="/regional-guides/costa-del-sol" onClick={() => setMenuOpen(false)}>Costa del Sol</Link></li>
              <li><Link to="/regional-guides/costa-blanca" onClick={() => setMenuOpen(false)}>Costa Blanca</Link></li>
              <li><Link to="/regional-guides/costa-brava" onClick={() => setMenuOpen(false)}>Costa Brava</Link></li>
            </ul>
          </li>
          <li className="dropdown" onMouseEnter={() => setPropertiesOpen(true)} onMouseLeave={() => setPropertiesOpen(false)}>
            <button className="dropdown-toggle" onClick={toggleProperties} aria-expanded={propertiesOpen}>
              Properties
            </button>
            <ul className={`dropdown-menu ${propertiesOpen ? 'open' : ''}`}>
              <li><Link to="/properties?category=beachfront-villas" onClick={() => setMenuOpen(false)}>Beachfront Villas</Link></li>
              <li><Link to="/properties?category=city-apartments" onClick={() => setMenuOpen(false)}>City Apartments</Link></li>
              <li><Link to="/properties?category=rural-fincas" onClick={() => setMenuOpen(false)}>Rural Fincas</Link></li>
              <li><Link to="/properties?category=investment-properties" onClick={() => setMenuOpen(false)}>Investment Properties</Link></li>
            </ul>
          </li>
          <li><Link to="/news" onClick={() => setMenuOpen(false)}>News & Blog</Link></li>
          <li><Link to="/magazine" onClick={() => setMenuOpen(false)}>Magazine</Link></li>
        </ul>
        <Link to="/contact" className="contact-button">Contact Us</Link>
      </nav>

      {/* Hero Section */}
      <HeroSection />

      {/* Regions Section */}
      <RegionsSection />

      {/* Featured Properties Section */}
      <FeaturedPropertiesSection />

      {/* Featured Agencies Section */}
      <FeaturedAgenciesSection />

      {/* Info Boxes Section */}
      <section className="info-boxes">
        <div className="info-box">
          <h3>Find Your Dream Home</h3>
          <p>Explore a wide range of properties tailored to your needs.</p>
        </div>
        <div className="info-box">
          <h3>Expert Regional Guides</h3>
          <p>Get insider tips and travel guides for every region.</p>
        </div>
        <div className="info-box">
          <h3>Trusted Agencies</h3>
          <p>Connect with reputable agencies for a smooth buying experience.</p>
        </div>
      </section>

      {/* Find Your Ideal Property Section */}
      <section className="ideal-property-section">
        <h2>Find Your Ideal Property</h2>
        <p>Browse our exclusive selection of properties by category</p>
        <div className="featured-agencies-cards">
          {[
            {
              img: "https://images.unsplash.com/photo-1501183638714-1f0a64c6ad9b?auto=format&fit=crop&w=400&q=80",
              title: "Beachfront Villas",
              description: "Luxurious villas with direct access to beautiful Spanish beaches",
              exploreLink: "/properties?category=beachfront-villas"
            },
            {
              img: "https://images.unsplash.com/photo-1560448070-8a1e0a7a1a0e?auto=format&fit=crop&w=300&q=80",
              title: "City Apartments",
              description: "Modern apartments in vibrant Spanish cities and towns",
              exploreLink: "/properties?category=city-apartments"
            },
            {
              img: "https://images.unsplash.com/photo-1505691938895-1758d7feb511?auto=format&fit=crop&w=300&q=80",
              title: "Rural Fincas",
              description: "Traditional Spanish countryside properties with land and privacy",
              exploreLink: "/properties?category=rural-fincas"
            },
            {
              img: "https://images.unsplash.com/photo-1494526585095-c41746248156?auto=format&fit=crop&w=300&q=80",
              title: "Investment Properties",
              description: "Properties with excellent rental potential and investment returns",
              exploreLink: "/properties?category=investment-properties"
            }
          ].map((property) => (
            <div key={property.title} className="agency-card">
              <img src={property.img} alt={property.title} className="agency-logo" />
              <div className="agency-content">
                <h3>{property.title}</h3>
                <p>{property.description}</p>
                <div className="agency-links">
                  <Link to={property.exploreLink} className="view-agency-link">Explore {property.title} Properties {'>'}</Link>
                </div>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Explore Destinations Section */}
      <ExploreDestinationsSection />

      {/* Latest News Section */}
      <LatestNewsSection />

      {/* Client Success Stories Section */}
      <ClientSuccessStoriesSection />

      {/* Inquiry Form Section */}
      <InquiryFormSection />

      {/* Footer Section */}
      <Footer />

    </div>
  );
};

export default HomePage;
